    def check(mid, b, c1, c2, q1):
        if mid + (b - mid * c1) // c2 < q1:
            return False
        return True
    max_aizu = min(b // c1, q2)
    if max_aizu < 0:
        return 'NA'
    if c2 >= c1:
        max_normal = (b - max_aizu * c1) // c2
        if max_aizu + max_normal < q1:
            return 'NA'
        else:
            return (max_aizu, max_normal)
    if (b - c1) // c2 + 1 < q1:
        return 'NA'
    left = 0
    right = max_aizu + 1
    while right - left > 1:
        mid = (left + right) // 2
        if check(mid, b, c1, c2, q1):
            left = mid
        else:
            right = mid
    return (left, (b - left * c1) // c2)

